example.code:
For SpaceBy2Points: Requires two Point3D objects to be passed.
oSpaceInputs[0].InputObject = Point3D(1);
oSpaceInputs[1].InputObject = Point3D(2);
oParentColl.Add(oSpaceInputs[0]);
oParentColl.Add(oSpaceInputs[1]);

For SpaceBy4Points: Requires 4 Point3d Objects to be passed. 
oSpaceInputs[0].InputObject = Point3D(1);
oSpaceInputs[1].InputObject = Point3D(2);
oSpaceInputs[2].InputObject = Point3D(3);
oSpaceInputs[3].InputObject = Point3D(4);
oParentColl.Add(oSpaceInputs[0]);
oParentColl.Add(oSpaceInputs[1]);
oParentColl.Add(oSpaceInputs[2]);
oParentColl.Add(oSpaceInputs[3]);

For Space using PlaneAndOffset: Requires 1Plane, 3 Point3D objects, and 2 offset values.
oSpaceInputs [0].InputObject = Plane;
offset values
oSpaceInputs [0].Offsets.Add(2.0);
oSpaceInputs [0].Offsets.Add(1.0);
oSpaceInputs [1].InputObject = Point3D(1);
oSpaceInputs [2].InputObject = Point3D(2);
oSpaceInputs [3].InputObject = Point3D(3);
oParentColl.Add(oSpaceInputs [0]);
oParentColl.Add(oSpaceInputs [1]);
oParentColl.Add(oSpaceInputs [2]);
oParentColl.Add(oSpaceInputs [3]);

For Space using Primitive: Requires 1 ShapeObject and 1 Point 3D object.
oSpaceInputs [0].InputObject = Shape;
oSpaceInputs [1].InputObject = Point3D;
oParentColl.Add(oSpaceInputs [0]);
oParentColl.Add(oSpaceInputs [1]);

For Space using Bound/Merge: Requires 2 or more volumes and the associated operation type. Currently, in space we cannot change the operation type once it is created.
Usage during creation time:
oSpaceInputs [0].InputObject =Volume1;
oSpaceInputs [0].BooleanOperationType = BooleanOperationType.UnionOperation;
oSpaceInputs [1].InputObject = Volume2;
oSpaceInputs [1].BooleanOperationType = BooleanOperationType.UnionOperation;
oParentColl.Add(oSpaceInputs [0]);
oParentColl.Add(oSpaceInputs [1]);

For Space using ByPath: Requires 1 CrossSection and 1 Path(Sketch Path).
oSpaceInputs [0].InputObject = CrossSection;
oSpaceInputs [1].InputObject = Path(Sketch Path);
oParentColl.Add(oSpaceInputs [0]);
oParentColl.Add(oSpaceInputs [1]);
